import React from "react";

const Event = ({ event }) => {
  return (
    <div>
      <Card>
        <Card.Header>{event.name}</Card.Header>
        <Card.Body>
          <Card.Title>{event.description}</Card.Title>
          <Card.Text>{event.targetAmount}</Card.Text>
          <Button variant="primary">Doar</Button>
        </Card.Body>
      </Card>
    </div>
  );
};

export default Event;
